            "value": 0,
            "color": "red"
          },
          {
            "id": 2,
            "label": "Test 2",
            "value": 0,
            "color": ["yellow", "green"]
          }
        ]
      },
      {
        "name": "Round 5",
        "values": [
          {
            "id": 1,
            "label": "Test 5",
            "value": 0,
            "color": "red"
          },
          {
            "id": 2,
            "label": "Test 2",
            "value": 0,
            "color": ["yellow", "green"]
          }
        ]
      },
    ]
  };

  render () {
    return (
      <div>
        {
      <DynamicBarChart
        data={this.state.data}
        iterationTimeout={10000}
      />
        }
      </div>
    )
  }
}
